import React from 'react'

const CatAPIObjects = (props) => {
    const breeds = props.breeds;
    const listItem = breeds.map((breed) =>
        <li key = {props.breeds.id}>
            {breed}
        </li>
    );
  return (
    <>      
        <ul>{listItem}</ul>
    </>
  )
}

export default CatAPIObjects
